% 
% PURPOSE: Given rxn indices in vector form, returns the name of the
% reaction(s), the species involved, genes associated, and lb/ub.
%
% INPUTS
%  cbModel: COBRA Toolbox formatted model
%  indices: vector of reaction indices in the S-matrix
%
% OPTIONAL INPUT
%  yeastFlag: Indicates if the model is for yeast so that common yeast gene names
%   associated with the rxns can be returned. Default assumes it's a yeast
%   model
%
% REFERENCE
%  Instructions for how to get the list of yeast systematic and common
%  names can be found in my cgpr code.
%

function rxnInfo(model,indices,yeastFlag)

if nargin<3
    yeastFlag=1;
end

% For each of the user-inputted rxn indices, output the names of the rxn's
% reactants and products.
for j=1:length(indices)  
    fprintf('\n********************** For reaction index %u **********************\n',indices(j));
%     % Print out rxn formulas
%     printRxnFormula(model,model.rxns(indices(j)),1,1,1);
%     fprintf('\n');    
    rxnName=model.rxnNames(indices(j));
    fprintf('rxnName: %s \n', char(rxnName{:}));
    rxn=model.rxns(indices(j));
    fprintf('rxn: %s \n', char(rxn{:}));
    
% Added this section - hwa 9/16/11
    genesInvolved=char(model.grRules(indices(j)));
    fprintf('\nGenes Associated: %s \n', genesInvolved);
